import React from 'react';
import { useHistory } from 'react-router-dom';
import './valmis.css';

const ValmisButton = () => {
    const history = useHistory();

    const navigateToContactPage = () => {
        history.push('/yhteydenotto'); // korvaa '/yhteydenotto' oikealla polulla
    };

    return (
        <button className="valmis-button" onClick={navigateToContactPage}>
            Valmis?
        </button>
    );
};

export default ValmisButton;
